import React, {Component} from "react";
import "./App.css";
import Header from "./header";

class App extends Component {

    componentDidMount() {
        fetch("https://newsapi.org/v2/sources?apiKey=4460b53fe7a040b68124fc9ae2a3c84c")
        .then(data => data.json())
        .then(json => json.sources.map(a => this.setState({
            data: a
        })))
        .catch(err => console.log(err));

        setTimeout(() => {
            this.setState({
                greeting : "bless you"
            });
        }, 3000);
    }

    state = {
        greeting : "hello junwoo!?"
    };

    render() {
        return (
            <div className = "App">
                {this.state.greeting}
                <Header />
            </div>
        );
    }
}

export default App;
